import {
    Button,
    Card,
    CardBody,
    CardHeader,
    Col,
    Container,
    Form,
    FormFeedback,
    FormGroup,
    Input,
    Label,
    Row,
  } from "reactstrap";
import Base from "../components/Base";
const Signup = () => {
  return (
    <Base>
      <Container>
        <Card>
          <CardHeader>
            <h3>Create a new account</h3>It's quick and easy.
          </CardHeader>

          <CardBody>
            {/* creating registerbody */}
            <Form>
                {/* namefild */}
              <FormGroup>
                <Input type="text" placeholder="" id="name" />
              </FormGroup>

                {/* Emailfild */}
                <FormGroup>
                <Input type="text" placeholder="email address" id="name" />
              </FormGroup>
            </Form>
          </CardBody>
        </Card>
      </Container>
    </Base>
  );
};

export default Signup;
